import React from 'react'

function Checkbox() {


  return (
    <div className="checkboxes flex flex-col space-y-2 w-full text-white text-xl">
          <label className='flex space-x-3 ' onClick={handleClick}><input type="checkbox"/><span>Include Uppercase Letters</span></label>
          <label className='flex space-x-3 ' onClick={handleClick}><input type="checkbox"/><span>Include Lowercase Letters</span></label>
          <label className='flex space-x-3 ' onClick={handleClick}><input type="checkbox"/><span>Include Numbers</span></label>
          <label className='flex space-x-3 ' onClick={handleClick}><input type="checkbox"/><span>Include Symbols</span></label>
    </div>
  )
}

export default Checkbox
